import style from './DogInfoPage.module.css';

export const DogInfoPage = () => {

    return (
        <div className={style.dogInfoPage}>
            <div className={style.returnBack}>
                <a className={style.returnBackButton}></a>
            </div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
        </div>
    )
}
